import React from "react";
import './Login.css';
import Login_C from '../../Components/Login_C';
import Navbar from '../../Components/Navbar';

const Login = () => {
return (
    <div>
        <Navbar/>
        <div className="container d-flex">
            <Login_C/>
        </div>
        
    </div>
    
);
};

export default Login;
